import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function ViewNotes() {
  const { id } = useParams();
  const [notes, setNotes] = useState([]);

  const listNotes = () => {
    const API_URL = "http://127.0.0.1:8000/test/listnotes/";
    axios
      .get(API_URL, {
        params: { id: id },
      })
      .then((response) => {
        console.log(response);
        setNotes(response.data.results);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  useEffect(() => {
    listNotes();
  }, []);

  return (
    <div>
      <h2>Notes</h2>
      <div>
      {notes.map((note) => {
          {
            console.log(note);
          }
          <h2>{note}</h2>
        })}
      </div>


      <h4>
          <a className="" href={"/addnotes/" + id}>
            <span>Add Note</span>
          </a>

      </h4>
    </div>
  );
}

export default ViewNotes;
